xec/PlistBuddy -c \"Set :CFBundleVersion ${buildNewVersion}\" \"${buildPlist}\"\n/usr/libexec/PlistBuddy -c \"Set :CFBundleShortVersionString ${buildNewVersion}\" \"${buildPlist}\"";
